import { NavBar } from "./navbar";
import { Spotlight } from "./spotlight";

export const LandingPage = () => {
  return (
    <div className="landing">
      <NavBar />
      <Hero />
      <Bestsellers />
      <Spotlight />
      <Category />

      <Footer />
    </div>
  );
};
